import { useState, useEffect } from 'react';

import MenuImg from './Images/menu.svg'
import SearchImg from './Images/searchNew.svg'

import Posts from './Components/Posts/Posts';

function App() {
  // UseEffect
  // useEffect (()=> {
  //   alert("Count changed to " +Counter);
  // },[Counter]);
  return (
    <div className="App">

      <CreatePostBtn />
      <TopBar />
    </div>
  );
}

function TopBar() {
  return (
    <>
      <div className='TopBar'>
        <button className='MenuBtn'><img src={MenuImg} ></img></button>
        <a className='Heading'>Twitter</a>
        <button className='SearchBtn'><img src={SearchImg} ></img></button>
      </div>
    </>
  )
}

function CreatePostBtn() {
  return (
    <><button className='CreatePostBtn'><img src={MenuImg} ></img></button></>
  )
}

export default App;
